import ReactDOM from 'react-dom';
import './index.css';
import Cards from './Cards';

ReactDOM.render(
  <>
    <div className='team-wrapper'>
       <h1 className='main-header'>Meet Our Team</h1>
      <div className='team-inner'>
        <Cards

          imgs="https://images.pexels.com/photos/220453/pexels-photo-220453.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260"
          name="John Smithi "
          position="Front End Developer"
          details="It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. "

        />

      </div>
    </div>
  </>,
  document.getElementById('root')







);
